import { createSlice } from "@reduxjs/toolkit";

const usersReducer = createSlice({
    name: 'users',
    initState: {
        users: [
            { id: 1, name: 'Asif' },
            { id: 2, name: 'Asif Gul' },
            { id: 3, name: 'Laila' }
        ]
    }
})

export default usersReducer.reducer;
